{
    long startTime = java.lang.System.currentTimeMillis();
    try {
        // Check cache first
        T cached = getCachedValue(key, type);
        if (cached != null) {
            recordMetric("cache.hits", ((java.lang.Long) (metrics.getOrDefault("cache.hits", 0L))) + 1);
            return cached;
        }
        // Execute supplier
        T result = supplier.get();
        // Cache result
        cacheValue(key, result);
        recordMetric("cache.misses", ((java.lang.Long) (metrics.getOrDefault("cache.misses", 0L))) + 1);
        return result;
    } finally {
        long executionTime = java.lang.System.currentTimeMillis() - startTime;
        recordExecutionTime("processWithCache", executionTime);
    }
}

