    }
    try {
        // Process payment
        com.testproject.PaymentResult result = paymentService.processPayment(order.getTotalAmount(), paymentRequest);
        if (result.isSuccessful()) {
            order.setStatus(com.testproject.OrderStatus.PROCESSING);
            order.getMetadata().put("paymentId", result.getTransactionId());
            order.getMetadata().put("paymentMethod", paymentRequest.getMethod());
            com.testproject.Order savedOrder = orderRepository.save(order);
            notificationService.sendPaymentConfirmation(savedOrder, result);
            return savedOrder;
        } else {
            throw new com.testproject.PaymentException("Payment failed: " + result.getErrorMessage());
